head.ready(function(){var e=$(".progress-bar"),c=$(".cycle-slideshow");c.on("cycle-initialized cycle-before",function(){e.stop(!0).css("width",0)}),c.on("cycle-initialized cycle-after",function(n,i){c.is(".cycle-paused")||e.animate({width:"100%"},i.timeout,"linear")}),c.on("cycle-paused",function(){e.stop()}),c.on("cycle-resumed",function(c,n,i){e.animate({width:"100%"},i,"linear")}),$(document.documentElement).keyup(function(e){37==e.keyCode?$(".cycle-slideshow").cycle("prev"):39==e.keyCode&&$(".cycle-slideshow").cycle("next")}),$(".fa-bars").click(function(){$(this).parent().find(".nav").toggleClass("is-open")})});